import React from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';

import $ from 'jquery';

import '../Style/Footer.css.css';


class Footer extends React.Component {

    componentDidMount(){
        AOS.init({
            duration : 2000
        })
    }

    render(){

        return(
            <div className= "footer">

            </div>
        )
    }
}

export default Footer;
